т нас своим знакомым и друзьям. \r\n \r\nНаша деятельность включает в себя: \r\n \r\nзащиту и представительство по уголовным, гражданским, административным и хозяйственным делам, \r\nзащиту и представительство по делам об административных правонарушениях, споры с патрульными, \r\nпомощь при ДТП, \r\nобжалование в вышестоящих судах приговоров, решений и определений судов (кассации и апелляции), \r\nспоры с врачами и медицинскими учреждениями, \r\nпомощь психолога и психотерапевта, обжалование выводов и заключений, \r\nперерасчет и правильность начисления пенсий, соц.выплат, субсидий, страховок, инвалидности (МСЭК) \r\nсудебные кредитные дела против Банков и коллекторов (валютные кредиты, ипотека, вопросы по банкам: Михайловский, Платинум, Дельта, Приват и иным...), \r\nсемейное (раздел имущества, алименты, расторжение брака, отцовство) и имущественное право, \r\nспоры с налоговой, пенсионным фондом и исполнительной службой, \r\nпомощь осужденным (УДО, льготы, амнистия, день СИЗО за два, освобождение по болезни, пересмотр приговоров и решений судов), \r\nнаследственное право, установление фактов и родства в суде, споры с нотариусами, \r\nжилищное и земельное право (аренда, продажа земли и пая), вопросы по недвижимости, сопровождение договоров купли-продажи, \r\nтрудовое право, служба в органах власти, \r\nадминистративное право, \r\n<a href=https://lawdnepr.com.ua/ru/contacts-military-lawyer-advocate-of-zaporizhzhia/>Военный адвокат</a> \r\nобращение в Европейский суд по правам человека, \r\nобжалование деяний полиции, сбу, прокуроров и судей, включая любых чиновников, \r\nзащита чести и достоинства, взыскание морального вреда, \r\nразработка различных правовых документов и договоров, \r\nпомощь в миграционном законодательстве, выезд за рубеж, консультации по гражданству, \r\nпомощь военнослужащим, вопросы по мобилизации, льготы участникам АТО, \r\nправовое обслуживание ФОП и предприятия, юридических лиц, \r\nучастие в переговорах, и многое другое.... \r\n \r\n \r\nус